// File contracts/GluwaAirdrop.sol

pragma solidity >=0.8.5;



contract GluwaAirdrop is OwnableUpgradeable {
    using SafeMath for uint256;

    uint256 private _fee;

    event EthTransfer(
        address indexed _from,
        uint256 _senderVal,
        address _to,
        uint256 _amount
    );

    function GluwaAirdrop_init() external initializer {
        __Ownable_init();
    }

    receive() external payable {
        emit EthTransfer(msg.sender, msg.value, address(this), msg.value);
    }

    function fee() external view returns (uint256) {
        return _fee;
    }

    function setFee(uint256 __fee) external onlyOwner {
        _fee = __fee;
    }

    function withdrawFund() external onlyOwner {
        uint256 totalBalance = payable(address(this)).balance;
        _safeTransfer(payable(msg.sender), totalBalance);
        emit EthTransfer(msg.sender, totalBalance, msg.sender, totalBalance);
    }

    function withdrawToken(IERC20 token) external onlyOwner() {
        uint256 totalTokenBalance = token.balanceOf(address(this));
        token.transfer(msg.sender, totalTokenBalance);
    }

    function multiTransfer(address[] memory addresses, uint256[] memory amounts)
        public
        payable
        onlyOwner
        returns (bool)
    {
        uint256 toReturn = msg.value;
        for (uint256 i = 0; i < addresses.length; i++) {
            toReturn = SafeMath.sub(toReturn, amounts[i]);
            _safeCall(addresses[i], amounts[i]);
            emit EthTransfer(msg.sender, msg.value, addresses[i], amounts[i]);
        }
        _safeTransfer(payable(msg.sender), toReturn);
        emit EthTransfer(msg.sender, msg.value, msg.sender, toReturn);
        return true;
    }

    function multiTransferTightlyPacked(bytes32[] memory addressesAndAmounts)
        public
        payable
        onlyOwner
        returns (bool)
    {
        uint256 toReturn = msg.value;
        for (uint256 i = 0; i < addressesAndAmounts.length; i++) {
            address to = address(bytes20(addressesAndAmounts[i] >> 96));
            uint256 amount = uint256(uint96(bytes12(addressesAndAmounts[i])));
            _safeCall(to, amount);
            toReturn = SafeMath.sub(
                toReturn,
                uint256(uint96(bytes12(addressesAndAmounts[i])))
            );
            emit EthTransfer(msg.sender, msg.value, to, amount);
        }
        _safeTransfer(payable(msg.sender), toReturn);
        emit EthTransfer(msg.sender, msg.value, msg.sender, toReturn);
        return true;
    }

    function multiTransferERC20(
        IERC20 token,
        address[] memory addresses,
        uint256[] memory amounts
    ) public {
        for (uint256 i = 0; i < addresses.length; i++) {
            token.transferFrom(msg.sender, addresses[i], amounts[i]);
        }
        token.transferFrom(msg.sender, owner(), _fee);
    }

    function multiTransferERC20TightlyPacked(
        IERC20 token,
        bytes32[] memory addressesAndAmounts
    ) public {
        for (uint256 i = 0; i < addressesAndAmounts.length; i++) {
            address to =
                address(uint160(uint256(addressesAndAmounts[i] >> 96)));
            uint256 amount = uint256(uint96(uint256(addressesAndAmounts[i])));
            token.transferFrom(msg.sender, to, amount);
        }
        token.transferFrom(msg.sender, owner(), _fee);
    }

    function _safeCall(address to, uint256 amount) private {
        require(to != address(0));
        (bool success, ) = to.call{value: amount}("");
        require(success);
    }

    function _safeTransfer(address payable to, uint256 amount) private {
        require(to != address(0));
        to.transfer(amount);
    }
}
